import React from "react";
import {NavLink} from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <NavLink to="/portfolio">Portfolio</NavLink>
            <NavLink to="/about">About Me</NavLink>
            <NavLink to="/resume">Resume</NavLink>
        </nav>
    );
};

export default Navbar;
